int spawn_pty_server(ak_fiot fctx)
{
    struct termios old_term, new_term;
    struct winsize winsize;
    char buffer[BUFSIZ];
    size_t length;
    message_t mtype = undefined_message;
    ak_uint8 *data = NULL;
    frame_type_t ftype;

    char is_found = 0;

    if (isatty(STDIN_FILENO)) {
        if (ioctl(STDIN_FILENO, TIOCGWINSZ, &winsize) < 0)
            perror("ioctl() error");
        else
            is_found = 1;
    }

    if (!is_found) {
        winsize.ws_col = 80;
        winsize.ws_row = 24;
    }

    log("winsize: %d:%d\n", winsize.ws_col, winsize.ws_row);

    if(ak_fiot_context_write_frame(fctx, (char *) &winsize, sizeof(struct winsize), encrypted_frame, application_data) != ak_error_ok) {
        debug_print("cannot send winsize\n");
        return EXIT_FAILURE;
    }
//    if (write(socket_fd, (char *) &winsize, sizeof(struct winsize)) != sizeof(struct winsize)) {
//        debug_print("cannot send winsize\n");
//        return EXIT_FAILURE;
//    }

    if (isatty(STDOUT_FILENO)) {
        if (tcgetattr(STDOUT_FILENO, &old_term) < 0) {
            perror("tcgetattr() error");
            return EXIT_FAILURE;
        }

        memcpy((void *) &new_term, (void *) &old_term, sizeof(new_term));

        new_term.c_iflag |= IGNPAR;
        new_term.c_iflag &= ~(ISTRIP | INLCR | IGNCR | ICRNL | IXON | IXANY | IXOFF);
        new_term.c_lflag &= ~(ISIG | ICANON | ECHO | ECHOE | ECHOK | ECHONL | IEXTEN);
        new_term.c_oflag &= ~(OPOST);

        new_term.c_cc[VMIN]  = 1;
        new_term.c_cc[VTIME] = 0;

        if (tcsetattr(STDOUT_FILENO, TCSADRAIN, &new_term) < 0) {
            perror("tcsetattr() error");
            return EXIT_FAILURE;
        }
    }

    while (1) {
        fd_set rset;
        int ret;

        FD_ZERO(&rset);
        FD_SET(STDIN_FILENO, &rset);
        FD_SET(fctx->iface_enc, &rset);

        ret = select(fctx->iface_enc + 1, &rset, NULL, NULL, &(struct timeval) { COMMAND_TIMEOUT, 0 });
        if (ret < 0) {
            if (errno == EINTR)
                continue;
            perror("select() error");
            break;
        }
        if (!ret) {
            printf("\n");
            log("timeout\n");
            break;
        }

        if (FD_ISSET(fctx->iface_enc, &rset)) {
            if (( data = ak_fiot_context_read_frame( fctx, &length, &mtype, &ftype )) != NULL) {
                ret = write(STDOUT_FILENO, data, length);
                if (ret <= 0) {
                    perror("write() error");
                    break;
                }
            } else {
                // fprintf(stderr, "crypto_recv() error\n");
                break;
            }
        }

        if (FD_ISSET(STDIN_FILENO, &rset)) {
            ret = read(STDIN_FILENO, buffer, BUFSIZ);
            if (ret == 0) {
                log("stdin eof\n");
                break;
            }
            if (ret < 0) {
                perror("read() error");
                break;
            }

            if (ak_fiot_context_write_frame( fctx, buffer, ret, encrypted_frame, application_data ) != ak_error_ok) {
                fprintf(stderr, "ak_fiot_context_write_frame() error\n");
            }
        }
    }

    if (isatty(STDOUT_FILENO)) {
        tcsetattr(STDOUT_FILENO, TCSADRAIN, &old_term);
    }

    log("connection has lost\n");

    return EXIT_SUCCESS;
}

